import React, {Component} from "react";
import NavLinks from '../navigation/navigationLink/navigationLinks';
import DropdownButton from '../navigation/navigatioDropdown/dropdownButton';
import Dropdown from './navigatioDropdown/dropdown';
import Aux from '../hoc/Auxiliary';
import logo from '../../assets/logo.PNG';
import "./navigation.css";

class Navigation extends Component{
  render(){
    return (
      <Aux>
        <Dropdown />
        <nav>
          <ul>
            <li>
              <img className="navLogo" src={logo} alt="Xpert Shop Logo" />
            </li>
          </ul>
          <NavLinks classes="desktopView"/>
          <DropdownButton classes="mobileView"/>
        </nav>
      </Aux>
    );
  }
};

export default Navigation;
